import React from "react";

const cardN = [{City: "Glasgow" , web:"html://www.peoplemakeglasgow.com"},
            {City: "Manchester" , web:"visitmanchester.com"},
            {City: "London" , web:"visitlondon.com"}
]
const TouristInfoCards = () => {
    cardN.map((element , index) => {
        return (
            <div className="card">
                <img src="https://image.flaticon.com/icons/svg/139/139899.svg" className="card-img-top" />
                <div className="card-body">
                <p> {element.City} </p>
            <a href={element.web} className="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        )
    })
}

export default TouristInfoCards;
